import ReactDOM from 'react-dom';
function Card(){
    return (
        <>
        <div className="cards">
          <div className="card">
             <img src="https://i.pinimg.com/originals/67/5e/bc/675ebc2fd210a8bd5362928a51514960.jpg" 
             alt="mypic" className="card_img" />
             <div className="card_info">
                <span className="card_category">A Netflix Orignal Series.</span>
                    <h3 className="card_title"> DARK </h3>
                        <a href="https://www.netflix.com/in/title/80100172" target="_blank">
                            <button>Watch Now</button>
                        </a>


             </div>
          </div>
        </div>
        </>

    );
}


ReactDOM.render(<Card />,
  document.getElementById("root")
);
